import axios from 'axios';

export function getParkings(location) {
    const config = {
        headers: {
            Authorization: "Bearer " + process.env.REACT_APP_YELP_API_KEY,
        },
        params: {
            limit: 6,
            term: 'parking',
            location: location,
            offset: 0,
        }
    }
    return (dispatch) => {
        return axios.get("http://localhost:3001/yelp", JSON.stringify(config))
            .then(res => JSON.parse(res))
            .then(res => console.log(res))
            .then(res => {
                dispatch({
                    type: 'GET_BUSINESS',
                    payload: res.data
                })
            })
            .catch(e => console.error(e))
    }
}
